  false,\n\t\"url\": null,\n\t\"notes\": \"This entry contains tidal information for
  Chesapeake Bay. Data wasnsubmitted by Saul Berkman, NOS Tides Branch, Oceanographic
  Division.nThese data are in NODC format. These data were collected roughly 37-39ndegrees
  N, 75 degrees W (stations were in Baltimore, Bayport VA,nCambridge MD, Cheathem
  Annex VA, Chesapeake City, MD, Gaskins Point, VA,nHampton Roads, VA, Kiptopeke Beach
  VA, Lower Marlboro, MD, Old PtnComfort VA, Portsmouth VA, Solomons MD, Taylor Island
  MD, Washington DC,nand Windmill Point VA. The data are in half-hourly units and
  includesnlatitude, longitude, date, time, and tidal height. The documentationndescribes
  the record format. Tide heights are referred to North AmericannDatum (NAD) 1929.\",\n\t\"owner_org\":
